import React, { useEffect } from 'react';


const UseEffect = () => {

	// const [value, setValue] = use

	useEffect(() => {
		console.log("02 USE EFFECT");
		return console.log("03 UNMOUNT")
	})

	return(
		<div>
		{console.log("01 RENDER")}
			<h1>01 UseEffect</h1>
		</div>
	);
}


export default UseEffect;
